import React, { useEffect } from "react";
import Input from "../../Input/Input";
import classes from "./CNFT.module.css";

const CNFT = ({data}, props) => {

  const { loanValueBorrow, repayInterestPlusLoan } = {...data};

  console.log(data)

  useEffect(()=>{
    if(isNaN(repayInterestPlusLoan)){
      return repayInterestPlusLoan = '';
    }
  }, [])

  return (
    <>
      <h2 className={props.header}>CNFT Trade</h2>
      <div className={props.container}>
        <h3>Project</h3>
        <Input title="Floor Price" />
        <Input title="Borrowed Amount" value={loanValueBorrow} />
        <Input title="Purchase Price" />
        <Input id='to' title="Borrowed Payment" value={repayInterestPlusLoan} />
        <Input title="Sale Price" />
        <Input title="Profit/Loss ADA" />
      </div>
    </>
  );
};

export default CNFT;
